import React from 'react';

const EllaBrandIcon = ({ className, width = 55, height = 24 }) => (
  <svg 
    className={`ella-brand-icon ${className || ''}`}
    width={width}
    height={height}
    viewBox="0 0 55 24"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
  >
    <text x="2" y="18" fontSize="16" fontWeight="600" fill="currentColor" fontFamily="system-ui, sans-serif">
      Ella
    </text>
  </svg>
);

export default EllaBrandIcon;
